-- ----------------------------
-- Table structure for fg_field
-- ----------------------------
DROP TABLE IF EXISTS `fg_field`;
CREATE TABLE `fg_field` (
  `ID` varchar(28) NOT NULL,
  `ENTITY_ID` varchar(8) DEFAULT '' COMMENT '主体ID',
  `FG_CODE` varchar(28) NOT NULL DEFAULT '' COMMENT 'Field group code ',
  `FIELD_CODE` varchar(28) NOT NULL DEFAULT '' COMMENT '为了防止FIELD_CODE重复，可以为编码规则:   OBJECT_code + "-"  FIELD NAME   ',
  `FIELD_NAME` varchar(40) NOT NULL DEFAULT '',
  `FIELD_TYPE` varchar(40) NOT NULL DEFAULT '' COMMENT '字段类型 (正整数, 日期;  单行文本, 单项选择)  ; 具体的属性，控件放在具体的表单里面(js) ',
  `VALUE` varchar(40) NOT NULL DEFAULT '' COMMENT '字段值',
  `FIELD_USAGE` varchar(40) NOT NULL DEFAULT '' COMMENT '字段用途',
  `IS_PUBLIC` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否为公用字段',
  `IS_SYSTEM` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否为系统字段',
  `SEQ` int(11) DEFAULT NULL,
  `DESCRIPTION` varchar(512) DEFAULT '' COMMENT '计算关系代码( 参考中国会计科目明细) ',
  `STATUS` tinyint(4) DEFAULT '1' COMMENT '-1 : to be archived\n               0:  表示无效. \n               1:表示有效 \n               ',
  `CRT_TIME` datetime DEFAULT NULL,
  `CREATOR` varchar(40) DEFAULT '' COMMENT '系统创建默认视图，个人创建自己的视图',
  `MOD_TIME` datetime DEFAULT NULL,
  `MODIFIER` varchar(40) DEFAULT '',
  `COMMENT` varchar(255) DEFAULT '',
  PRIMARY KEY (`ID`),
  KEY `INDEX_FG_FIELDS_FG_CODE` (`ENTITY_ID`,`FG_CODE`,`FIELD_CODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='字段组字段';

-- ----------------------------
-- Records of fg_field
-- ----------------------------

-- ----------------------------
-- Table structure for field_group
-- ----------------------------
DROP TABLE IF EXISTS `field_group`;
CREATE TABLE `field_group` (
  `ID` varchar(28) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `FG_CODE` varchar(28) NOT NULL DEFAULT '' COMMENT 'Field group code ',
  `ENTITY_ID` varchar(8) NOT NULL DEFAULT '' COMMENT '主体ID',
  `FG_NAME` varchar(40) NOT NULL DEFAULT '' COMMENT 'Field group name',
  `FG_FNAME` varchar(255) NOT NULL DEFAULT '' COMMENT '字段组全称',
  `VIEW_TYPE` varchar(10) NOT NULL DEFAULT '' COMMENT 'single表示字段组的字段单一显示；multi表示字段组的字段以列表方式显示；radio表示组合字段组的字段组的单选方式；combi表示组合字段组的字段组多选方式；',
  `IS_COMPOSITE_FG` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是不是子表/复合字段组; 如果是, 则为true\n            ',
  `IS_EXTENDED` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否可扩展',
  `REMARK` text COMMENT '备注',
  `FG_IN_OUT` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1:表示入, in \n            2: 表示出 ,out ',
  `STATUS` tinyint(4) NOT NULL DEFAULT '1' COMMENT '-1 : to be archived\n               0:  表示无效. \n               1:表示有效 \n               ',
  `CRT_TIME` datetime NOT NULL,
  `CREATOR` varchar(40) NOT NULL DEFAULT '' COMMENT '系统创建默认视图，个人创建自己的视图',
  `MOD_TIME` datetime DEFAULT NULL,
  `MODIFIER` varchar(40) DEFAULT '',
  `COMMENT` varchar(255) DEFAULT '',
  `DESCRIPTION` text,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of field_group
-- ----------------------------

