DROP TABLE IF EXISTS `match_rel`;
CREATE TABLE `match_rel` (
  `ID` varchar(28) NOT NULL,
  `TRANS_TYPE` varchar(60) NOT NULL DEFAULT '' COMMENT '交易类型',
  `CALC_REL_CODE` varchar(60) NOT NULL DEFAULT '' COMMENT '计算关系编码',
  `MATCH_DIRECTION` tinyint(4) DEFAULT NULL COMMENT '核销方向',
  `MATCH_REL_CODE` varchar(60) NOT NULL DEFAULT '' COMMENT '核销编码',
  `ENTITY_ID` varchar(8) DEFAULT NULL,
  `STATUS` tinyint(4) DEFAULT NULL,
  `MATCH_REL_NAME` varchar(60) NOT NULL DEFAULT '' COMMENT '核销类型名称',
  `CRT_TIME` datetime DEFAULT NULL,
  `CREATOR` varchar(40) DEFAULT NULL,
  `MOD_TIME` datetime DEFAULT NULL,
  `MODIFIER` varchar(40) DEFAULT NULL,
  `COMMENT` varchar(255) DEFAULT NULL,
  `FG_CODE` varchar(28) DEFAULT NULL,
  `DESCRIPTION` varchar(512) DEFAULT '' COMMENT '描述',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

