-- ----------------------------
-- Table structure for rpobject
-- ----------------------------
DROP TABLE IF EXISTS `rpobject`;
CREATE TABLE `rpobject` (
  `ID` varchar(28) NOT NULL DEFAULT '',
  `ENTITY_ID` varchar(8) NOT NULL DEFAULT '' COMMENT '主体ID',
  `OBJ_TYPE` varchar(10) NOT NULL DEFAULT '' COMMENT '对象的类型==>字段组编码',
  `OBJ_CODE` varchar(28) NOT NULL DEFAULT '' COMMENT '对象编号; 主体地址: "ADDR“ + EntityID +  SEQ',
  `OBJ_NAME` varchar(200) NOT NULL DEFAULT '' COMMENT '对象名称',
  `OBJ_CATE` varchar(28) DEFAULT '' COMMENT '对象的分类(如果是商品，则是商品分类)',
  `OBJECT_EXT` text,
  `CUR_VERSION` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否为当前版本, 1 表示当前版本 (可以多个版本);  0 表示历史版本;  2 为草稿版本(可以直接修改而不生成新版本). ',
  `MEASURE_UNIT` varchar(8) DEFAULT '' COMMENT '单位',
  `HAS_SUB_OBJECT` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否有子对象， 1 true  (如果有BOM, 肯定有子对象, 也为true)',
  `DESCRIPTION` varchar(255) DEFAULT NULL,
  `VERSION` int(11) NOT NULL DEFAULT '1' COMMENT '版本号;  ',
  `OBJ_TAG` varchar(16) DEFAULT '' COMMENT '对象标签1(针对商品，则是商品标签)',
  `OBJ_TAG2` varchar(16) DEFAULT '' COMMENT '对象标签2(针对商品，则是应用标签:采购，销售, 加工)',
  `REFERENCE_CODE` varchar(50) DEFAULT '' COMMENT '参考Code (国富项目临时用)',
  `REFERENCE_TYPE` varchar(10) DEFAULT '' COMMENT '针对存货对象, 如果是外购 , 则为(P) , 如果是销售则为(S), 如果是自己制造则为(M)',
  `STATUS` tinyint(4) NOT NULL DEFAULT '1' COMMENT '-1 : to be archived\n               0:  表示无效. \n               1:表示有效 \n               ',
  `CRT_TIME` datetime NOT NULL,
  `CREATOR` varchar(40) NOT NULL DEFAULT '' COMMENT '系统创建默认视图，个人创建自己的视图',
  `MOD_TIME` datetime DEFAULT NULL,
  `MODIFIER` varchar(40) DEFAULT '',
  `COMMENT` varchar(255) DEFAULT '',
  PRIMARY KEY (`ID`),
  KEY `INDEX_OBJ_CODE` (`OBJ_CODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='所有字段组( 基础对象/对象关系)';

-- ----------------------------
-- Records of rpobject
-- ----------------------------

-- ----------------------------
-- Table structure for rpobject_rel
-- ----------------------------
DROP TABLE IF EXISTS `rpobject_rel`;
CREATE TABLE `rpobject_rel` (
  `ID` varchar(40) NOT NULL DEFAULT '',
  `ENTITY_ID` varchar(8) NOT NULL DEFAULT '' COMMENT '主体ID',
  `REL_TYPE` varchar(8) NOT NULL DEFAULT '' COMMENT '关系类型,( 如果是商品间关系，可以是gods)',
  `OBJ_ID` varchar(28) NOT NULL DEFAULT '',
  `PARENT_ID` varchar(28) NOT NULL DEFAULT '',
  `MEASURE_UNIT` varchar(8) DEFAULT '' COMMENT '单位',
  `QTY` decimal(12,4) NOT NULL DEFAULT '0.0000',
  `AMOUNT` decimal(15,6) DEFAULT '0.000000' COMMENT '金额。这里小数保持6位，是因为这里的金额可能会是单价的意思. ',
  `WASTE_RATE` decimal(6,6) DEFAULT '0.000000' COMMENT '损耗率',
  `DISTRIBUTION` decimal(6,6) DEFAULT '0.000000' COMMENT '分摊比例. ',
  `REL_EXT` varchar(1000) DEFAULT '' COMMENT 'BOM 扩充字段',
  `STATUS` tinyint(4) NOT NULL DEFAULT '1' COMMENT '-1 : to be archived\n               0:  表示无效. \n               1:表示有效 \n               ',
  `CRT_TIME` datetime NOT NULL,
  `CREATOR` varchar(40) NOT NULL DEFAULT '' COMMENT '系统创建默认视图，个人创建自己的视图',
  `MOD_TIME` datetime DEFAULT NULL,
  `MODIFIER` varchar(40) DEFAULT '',
  `COMMENT` varchar(255) DEFAULT '',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='对象间关系表';

-- ----------------------------
-- Records of rpobject_rel
-- ----------------------------

-- ----------------------------
-- Table structure for stock_bal_detail
