DROP TABLE IF EXISTS `stock_bal_detail`;
CREATE TABLE `stock_bal_detail` (
  `ID` varchar(40) NOT NULL,
  `ENTITY_ID` varchar(8) NOT NULL DEFAULT '' COMMENT '主体ID',
  `INVENTORY_CODE` varchar(20) NOT NULL DEFAULT '' COMMENT '存货对象编码',
  `WAREHOUSE_CODE` varchar(50) NOT NULL DEFAULT '' COMMENT '仓库对象编码',
  `QTY` decimal(20,6) DEFAULT '0.000000' COMMENT 'Quantity 数量',
  `QTY_LOCKED` decimal(22,6) DEFAULT '0.000000' COMMENT '可被核销余额中, 被锁定部分。 该值<QTY_TB_CLEAR',
  `AMNT_LOCKED` decimal(22,6) DEFAULT NULL,
  `MATCHED_CALC_ID` varchar(40) DEFAULT '' COMMENT '计算库记录的ID(被核销方的ID, 比如入库记录)',
  `MATCH_TRANS_CODE` varchar(40) DEFAULT '' COMMENT '核销方的交易号',
  `MATCH_TRANS_DET_ID` varchar(40) DEFAULT '' COMMENT '核销方的交易明细ID(from TRANS_DETAIL.ID)',
  `CALC_REL` varchar(40) DEFAULT '' COMMENT '计算关系',
  `STATUS` tinyint(4) NOT NULL DEFAULT '1' COMMENT '-1 : to be archived\n            0:  表示无效. \n            1:表示有效 \n            ',
  `CRT_TIME` datetime DEFAULT NULL,
  `CREATOR` varchar(40) DEFAULT '',
  `MOD_TIME` datetime DEFAULT NULL,
  `MODIFIER` varchar(40) DEFAULT '',
  `COMMENT` varchar(255) DEFAULT '',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

