-- ----------------------------
-- Table structure for trans_detail
-- ----------------------------
DROP TABLE IF EXISTS `trans_detail`;
CREATE TABLE `trans_detail` (
  `ID` varchar(28) NOT NULL DEFAULT '',
  `ENTITY_ID` varchar(8) NOT NULL DEFAULT '' COMMENT '主体ID',
  `TRANS_CODE` varchar(40) NOT NULL DEFAULT '' COMMENT '和交易组表的trans_id对应',
  `TRANS_OBJ_ID` varchar(28) NOT NULL DEFAULT '0' COMMENT '存货，资金; 对应 trans_det_calc.trans_attr1 ',
  `FG_CODE` varchar(28) NOT NULL DEFAULT '' COMMENT '表示组合字段组编码，方便查找其对应的计算关系\r\n            ',
  `CONTAINER_ID` varchar(28) NOT NULL DEFAULT '0' COMMENT '容器 ID (目前只有仓库)',
  `BATCH_NO` varchar(28) NOT NULL DEFAULT '' COMMENT '批号',
  `BATCH_TIME` datetime NOT NULL,
  `DEALER_ID` varchar(28) NOT NULL DEFAULT '0' COMMENT '供应商or 客户',
  `CONTACT_ID` varchar(28) NOT NULL DEFAULT '0',
  `TRANS_BOM_FLAG` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'TRANsactoin BOM status \r\n    交易是否有临时的BOM(  假如用户临时修改BOM的话，就会有)； 如果有，就可以根据TRANS_DET_ID去找TRANS_BOM',
  `TRANS_MATCHED_CODE` varchar(28) NOT NULL DEFAULT '' COMMENT '被核销交易号 (对应核销交易号的被核销交易号)',
  `MEASURE_UNIT` varchar(8) NOT NULL DEFAULT '' COMMENT '单位',
  `PRICE` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '含税单价(如果不含税，对应税率就是0)',
  `QTY` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT 'Quantity 数量',
  `AMOUNT` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '金额里面可以包含税-有税的时候, 也可以不包括税-没税的时候',
  `AMOUNT_COST` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '(成本金额 ), 为了预先计算成本',
  `TAX_RATE` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '税率',
  `TAX_AMOUNT` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '税金',
  `PROM_DELI_TIME` datetime NOT NULL COMMENT '承诺交付时间',
  `TRANS_D_EXT` text,
  `REMARK` varchar(200) DEFAULT '',
  `CALC_STATUS` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已经计算:  缺省为False ',
  `DETAIL_IN_OUT` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0:无出入类型; 1:表示入 in;2: 表示出 ,out',
  `TRANS_TYPE` varchar(28) NOT NULL DEFAULT '' COMMENT '冗余以下字段 trans_main.TRANS_TYPE, 为了加快计算速度\n            ',
  `EFFECTIVE_TIME` datetime DEFAULT NULL COMMENT '冗余以下字段 trans_main.effetive_time, 为了加快计算速度',
  `STATUS` tinyint(4) NOT NULL DEFAULT '1' COMMENT '-1 : to be archived\n            0:  表示无效. \n            1:表示有效 \n            ',
  `CRT_TIME` datetime NOT NULL,
  `CREATOR` varchar(40) NOT NULL DEFAULT '',
  `MOD_TIME` datetime DEFAULT NULL,
  `MODIFIER` varchar(40) DEFAULT '',
  `COMMENT` varchar(255) DEFAULT '',
  PRIMARY KEY (`ID`),
  KEY `TRANS_DET_STOCK_BATCH_IDX` (`TRANS_OBJ_ID`,`BATCH_NO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='交易业务数据_详细(Detail) (相当于原始凭证录入) : 存货批次相关';

-- ----------------------------
-- Records of trans_detail
-- ----------------------------

-- ----------------------------
-- Table structure for trans_type
-- ----------------------------
DROP TABLE IF EXISTS `trans_type`;
CREATE TABLE `trans_type` (
  `ID` varchar(28) NOT NULL DEFAULT '',
  `ENTITY_ID` varchar(8) DEFAULT '' COMMENT '主体ID',
  `TRANS_TYPE` varchar(40) NOT NULL COMMENT '交易类型编码',
  `TRANS_NAME` varchar(40) NOT NULL COMMENT '交易类型名称',
  `TRANS_FNAME` varchar(60) NOT NULL,
  `BIG_TYPE` varchar(40) NOT NULL COMMENT '大类Code: 对象类，对象关系类, 交易类',
  `BIG_TYPE_CN` varchar(40) NOT NULL COMMENT '大类:中文名字 对象类，对象关系类, 交易类',
  `SMALL_TYPE` varchar(40) NOT NULL COMMENT '小类Code : 存货类(Under 经营类)',
  `SMALL_TYPE_CN` varchar(40) NOT NULL COMMENT '小类名字 : 存货类(Under 经营类)',
  `IS_EFFECTIVE` tinyint(4) DEFAULT '1' COMMENT '是否生效',
  `STATUS` tinyint(4) DEFAULT '1' COMMENT '-1 : to be archived\n            0:  表示无效. \n            1:表示有效 \n            ',
  `CRT_TIME` datetime DEFAULT NULL,
  `CREATOR` varchar(40) DEFAULT '',
  `MOD_TIME` datetime DEFAULT NULL,
  `MODIFIER` varchar(40) DEFAULT '',
  `COMMENT` varchar(255) DEFAULT '',
  PRIMARY KEY (`ID`),
  KEY `AK_TRANS_TYPE_TYPE` (`ENTITY_ID`,`TRANS_TYPE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='交易类型编码';

-- ----------------------------
-- Records of trans_type
-- ----------------------------
